class FormasDePago extends React.Component {

    render() {
        return(
            <h2>Porque nuestra misión es hacer que viajes junto a tus seres queridos sin preocuparte por nada, hemos diseñado las siguientes formas de pago para que cumplas tu deseo de viajar</h2>
        )
    }
}


export default FormasDePago
